import React, { useState, useEffect } from "react";
import './Test.css'
import { Questions } from "./Questions";
import { Link, useNavigate } from "react-router-dom";
import Result from "./Result";

function predictWithMLModel(inputData) {
  return fetch('http://127.0.0.1:5000/predict', {
      method: 'POST',
      headers: {
          'Content-Type': 'application/json'
      },
      body: JSON.stringify(inputData)
  })
  .then(response => response.json())
  .then(predictions => {
      console.log('Predictions: ', predictions);
      return predictions;
  })
  .catch(error => {
      console.error('Error:', error);
      return null;
  });
}

const inputData = [2, 100, 72, 100, 33.6, 50];

function Test() {
  const [predictions, setPredictions] = useState(null);
  const [index, setIndex] = useState(0);
  const [question, setQuestion] = useState(Questions[index]);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [slider0Value, setSlider0Value] = useState(0);
  const [slider4Value, setSlider4Value] = useState(0);
  const [slider6Value, setSlider6Value] = useState(0);
  const [result, setResult] = useState(false);
  const [isAnswered, setIsAnswered] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      const predictions = await predictWithMLModel(inputData);
      setPredictions(predictions);
    };
    fetchData();
  }, []);

  useEffect(() => {
    setQuestion(Questions[index]);
    setIsAnswered(false);
    setSelectedAnswer(null);
  }, [index]);

  const checkAns = (ans) => {
    setSelectedAnswer(ans);
    setIsAnswered(true);
  };

  const handleSlider0Change = (e) => {
    setSlider0Value(parseFloat(e.target.value));
    setIsAnswered(true); 
  };

  const handleSlider4Change = (e) => {
    setSlider4Value(parseFloat(e.target.value));
    setIsAnswered(true); 
  };

  const handleSlider6Change = (e) => {
    setSlider6Value(parseFloat(e.target.value));
    setIsAnswered(true); 
  };

  const reset = () => {
    setIndex(0);
    setSelectedAnswer(null);
    setSlider0Value(0);
    setSlider4Value(0);
    setSlider6Value(0);
    setResult(false);
  };

  const next = () => {
    if (index === Questions.length - 1) {
      setResult(true);
      return;
    }
    setIndex(prevIndex => prevIndex + 1);
    setSlider0Value(0); 
    setSlider4Value(0);
    setSlider6Value(0);
  };

  const navigate=useNavigate();
  const handleClick=()=>{
    navigate('/')
  }
  

  return (
    <>
    <header>
        <h2 className="logo">GlucoWise</h2>
        <nav className="navigation">
          <Link to="/">Home</Link>
          <Link to="#">News</Link>
          <Link to="#">Feedback</Link>
          <Link to="#">About</Link>
          <button onClick={handleClick} className="loginbtn">Logout</button>
        </nav>
      </header>
    <div className="container">
      <h1>Diabetes Prediction Test</h1>
      <hr />
      {result ? (
        <>
          <h2>Test is submitted successfully</h2>
          <h2>with prob {predictions}</h2>
          <button className="reset" onClick={reset}>Reset</button>
          <Link to='/result' className="result">See Result</Link>
        </>
      ) : (
        <>
          <h2>{index+1}. {question.question}</h2>
          {(index === 0) && (
            <>
              <input
                className="slider"
                type="range"
                min={0}
                max={100}
                value={slider0Value}
                onChange={handleSlider0Change}
              />
              <p>Value: {slider0Value} years</p>
            </>
          )}
          {(index === 4) && (
            <>
              <input
                className="slider"
                type="range"
                min={0}
                max={300}
                value={slider4Value}
                onChange={handleSlider4Change}
              />
              <p>Value: {slider4Value} mg/dL</p>
            </>
          )}
          {(index === 6) && (
            <>
              <input
                className="slider"
                type="range"
                min={0}
                step={0.1}
                max={100}
                value={slider6Value}
                onChange={handleSlider6Change}
              />
              <p>Value: {slider6Value} kg/m2</p>
            </>
          )}
          <ul>
            {Object.keys(question).filter(key => key.startsWith("option")).map((option, i) => (
              <li
                key={option}
                className={selectedAnswer === i + 1 ? "selected" : ""}
                onClick={() => checkAns(i + 1)}
              >
                {question[option]}
              </li>
            ))}
          </ul>
          {index !== 0 && (
            <button className="prev" onClick={() => setIndex(prevIndex => prevIndex - 1)}>Previous</button>
          )}
          <button className="next" onClick={next} disabled={!isAnswered}>Next</button>
          <div className="index">{index+1} of {Questions.length} questions</div>
          {selectedAnswer !== null }
        </>
      )}
      <Result predictionResult={predictions}/>
    </div>
    </>
  );
}

export default Test;
